.post-content {
  margin-top: -34px;
  padding-bottom: 40px;
}

.post-card {
  padding: 35px;
  background: #fff;
  transition: 0.2s all ease-in-out;
  border-radius: 9px;
  box-shadow: 0 8px 10px -5px rgba(0, 0, 0, 0.2), 0 16px 24px 2px rgba(0, 0, 0, 0.14), 0 6px 30px 5px rgba(0, 0, 0, 0.12);
}

@media (max-width: 1200px) {
  .post-card {
    margin-right: 0;
    padding: 13px;
  }
}

@media (max-width: 768px) {
  .post-card {
    border-radius: 0;
    box-shadow: none;
  }
}
